import React from "react";
import styles from '../index.module.css';

export default function Betting() {
  const chip = <img src="/pokerchip.png" alt="poker chip" width="100%" height="100%" className={styles.imageStyle} />;
  return (
    <div className={styles.row}>
      <div className={styles.chipcontainer}>
        <div className={styles.textstyle}>1</div>
        {chip}
      </div>
      <div className={styles.chipcontainer}>
        <div className={styles.textstyle}>5</div>
        {chip}
      </div>
      <div className={styles.chipcontainer}>
        <div className={styles.textstyle}>10</div>
        {chip}
      </div>
      <div className={styles.chipcontainer}>
        <div className={styles.textstyle}>25</div>
        {chip}
      </div>
      <div className={styles.chipcontainer}>
        <div className={styles.textstyle}>100</div>
        {chip}
      </div>
      <div className={styles.chipcontainer}>
        <div className={styles.textstyle}>500</div>
        {chip}
      </div>
      <div className={styles.chipcontainer}>
        <div className={styles.textstyle}>1000</div>
        {chip}
      </div>
    </div>
  );
}
